import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import LogoutConfirmationModal from './LogoutConfirmationModal'; // ðŸ‘ˆ import modal
import '../styles/Navbar.css';

function Navbar() {
  const [showLogoutModal, setShowLogoutModal] = useState(false);
  const navigate = useNavigate();

  const handleLogout = () => {
    // Additional logout logic can be added here (e.g., clearing auth tokens)
    setShowLogoutModal(false); // Close the modal
    navigate('/'); // Navigate to the home page after logout
  };

  return (
    <>
      <nav className="navbar">
        <div className="navbar-left">
          <span className="logo" onClick={() => navigate('/user')}>SkillShare</span>
        </div>
        <div className="navbar-right">
          <button
            className="btn login-btn"
            onClick={() => setShowLogoutModal(true)}
          >
            Logout
          </button>
        </div>
      </nav>

      <LogoutConfirmationModal
        show={showLogoutModal}
        onConfirm={handleLogout}  // Handle logout
        onCancel={() => setShowLogoutModal(false)}  // Close the modal on cancel
      />
    </>
  );
}

export default Navbar;
